import React from 'react';
import './App.css';
import ExpenseEntryItem from './components/ExpenseEntryItem';
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      item1: {
        id:1,
        name:"Mango",
        price:34,
        date:"2022-12-12",
        category:"Food"
      },
      item2: {
        id:1,
        name:"Mango",
        price:34,
        date:"2022-12-12",
        category:"Food"
      }
    }
  }
  render() {
    return(
      <div>
        for(let items in this.state) {
          <ExpenseEntryItem item={this.state[items]} />
        }


      </div>
    )
  }
}

export default App;
